        "rights": MessageLookupByLibrary.simpleMessage("权利"),
        "rightsA1": MessageLookupByLibrary.simpleMessage(
            "寻求庇护者和获得难民身份或保护的人因不同原因享有各种权利，这些权利由接纳国负责确保。这些权利在难民公约和人权公约中规定。这些权利包括在接纳国居留并不被遣返（例如不被强制遣返），并涵盖教育、医疗保健、住房、工作和家庭等其他事项。"),
        "rightsA2": MessageLookupByLibrary.simpleMessage(
            "这是将国际习惯法和国际法令汇编起来，以确定保护难民所需的标准。 1951年公约及其1967年的议定书奠定了避难法的基础。 避难法与人权国际法互为补充，同样国际人权法也与国际习惯法相辅相成。"),
        "rightsA3": MessageLookupByLibrary.simpleMessage(
            "对于生命或自由受到威胁的难民、寻求庇护者和其他人来说，这是一个重要权利。 这些人有权不被接纳国遣返到其原籍国或可能受到危险或伤害的其他国家。 这一权利，称为非遣返原则，被载入了难民公约及其他人权公约，也是习惯国际法的一部分，因此所有国家都应该确保其实施。"),
        "rightsA4": MessageLookupByLibrary.simpleMessage(
            "难民保护涉及到旨在全面尊重难民权利的所有活动。 这种保护包括提供一个尊重人类尊严的环境，防止或减轻特定虐待模式的直接影响，以及通过赔偿和重建来恢复体面的生活条件。"),
        "rightsA5": MessageLookupByLibrary.simpleMessage(
            "是的，难民享有人权。 人权通常被理解为仅因为一个人是人类而应享有的不可剥夺的权利。 它们基于普遍性、平等和非歧视等基本原则，并由旨在确保其完全享有的条约、习惯法、国内法和其他标准所确定和帮助。"),
        "rightsA6part1": MessageLookupByLibrary.simpleMessage(
            "作为1951年难民公约或1954年无国籍公约缔约国之一的难民或无国籍人，在这些国家，您有权获得“公约旅行证件”，该证件可替代您的国家护照。"),
        "rightsA6part2": MessageLookupByLibrary.simpleMessage(
            "作为难民，使用“公约旅行证件”旅行比使用国家护照更安全，因为您受到不会被强行遣返到原籍国的保护。"),
        "rightsA6part3": MessageLookupByLibrary.simpleMessage(
            "实际上，并非所有国家都颁发公约旅行证件，尽管它们有义务如此。 一些国家为难民和无国籍人颁发其他旅行文件，例如外国人护照或专用旅行身份文件。"),
        "rightsA6part4": MessageLookupByLibrary.simpleMessage(
            "在某些国家，当您没有其他选择时，国际红十字会可能会帮助您获得紧急旅行文件。 这个文件仅适用于一次旅行。"),
